	DECLARE @sSPCode_0 nvarchar(MAX),
		@FrameworkPath nvarchar(2000),
		@iSQLVersion integer,
		@bIs64Bit bit

	-- 64 bit ?
	SELECT @bIs64Bit = CASE PATINDEX ('%X64)%' , @@version)	WHEN 0 THEN 0 ELSE 1 END

	-- SQL version
	SELECT @iSQLVersion = convert(float,substring(@@version,charindex('-',@@version)+2,2))

	-- Remove existing assembly
	IF EXISTS(SELECT [name] FROM sysobjects WHERE id = object_id('spASRDropServerAssembly') AND sysstat & 0xf = 4)
		EXEC [spASRDropServerAssembly]

	-- Create the directory services assembly
	IF EXISTS(SELECT [name] FROM sys.assemblies WHERE [name] = 'System.DirectoryServices')
	    DROP ASSEMBLY [System.DirectoryServices] WITH NO DEPENDENTS

	IF NOT EXISTS(SELECT [name] FROM sys.assemblies WHERE [name] = 'System.DirectoryServices')
	BEGIN

		IF @bIs64Bit = 1
			SET @FrameworkPath = 'C:\Windows\Microsoft.NET\Framework64\v2.0.50727\System.DirectoryServices.DLL'
		ELSE
			SET @FrameworkPath = 'C:\Windows\Microsoft.NET\Framework\v2.0.50727\System.DirectoryServices.DLL'

		IF @iSQLVersion = 11
			IF @bIs64Bit = 1
				SET @FrameworkPath = 'C:\Windows\Microsoft.NET\Framework64\v4.0.30319\System.DirectoryServices.DLL'
			ELSE
				SET @FrameworkPath = 'C:\Windows\Microsoft.NET\Framework\v4.0.30319\System.DirectoryServices.DLL'

		CREATE ASSEMBLY [System.DirectoryServices]
		AUTHORIZATION [dbo]
			FROM @FrameworkPath
		WITH PERMISSION_SET = UNSAFE
	END
	
	-- Create the server framework assembly
	CREATE ASSEMBLY [System Framework Assembly]
	AUTHORIZATION [dbo]
	FROM 
	WITH PERMISSION_SET = UNSAFE

